css:
.editor {
  background-color: #fafcff;
  color: #272727;
}
.editor .gutter {
  background-color: #fafcff;
  color: #272727;
}
.editor .gutter .line-number.cursor-line {
  background-color: #f5f7fa;
  color: #272727;
}
.editor .gutter .line-number.cursor-line-no-selection {
  color: #272727;
}
.editor .wrap-guide {
  color: #f8f8f8;
}
.editor .indent-guide {
  color: #f8f8f8;
}
.editor .invisible-character {
  color: #fafcff;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: #f8f8f8;
}
.editor .search-results .marker.current-result .region {
  border: #272727;
}
.editor.is-focused .cursor {
  border-color: #000000;
}
.editor.is-focused .selection .region {
  background-color: #e1ecf2;
}
.editor.is-focused .line-number.cursor-line-no-selection,
.editor.is-focused .line.cursor-line {
  background-color: #f5f7fa;
}
.comment,
.string.quoted.double.block.python {
  font-style: italic;
  color: #678E68;
}
.string {
  color: #932323;
}
.constant.numeric {
  color: #c23838;
}
.constant.language {
  color: #46758c;
}
.variable.language,
.variable.other {
  color: #414141;
}
.keyword {
  font-weight: bold;
  color: #714d99;
}
.storage {
  font-weight: bold;
  color: #714d99;
}
.entity.name.class {
  color: #cd751b;
}
.entity.name.function {
  font-weight: bold;
  color: #aa5c1b;
}
.support.function {
  color: #46758c;
}
.invalid {
  color: #FF0000;
  background-color: rgba(252, 0, 10, 0.5);
}
.entity.name {
  font-weight: bold;
  color: #b65c1b;
}
.sublimelinter.annotations {
  color: #FFFFFF;
  background-color: #FFFFAA;
}
.sublimelinter.outline.illegal {
  color: #FFFFFF;
  background-color: #FF4A52;
}
.sublimelinter.underline.illegal {
  background-color: #FF0000;
}
.sublimelinter.outline.warning {
  color: #FFFFFF;
  background-color: #DF9400;
}
.sublimelinter.underline.warning {
  background-color: #FF0000;
}
.sublimelinter.outline.violation {
  color: #FFFFFF;
  background-color: rgba(255, 255, 255, 0.2);
}
.sublimelinter.underline.violation {
  background-color: #FF0000;
}
